import React from "react";

const Profileicons = () => {
  return (
    <div className="vector-icon-frame">
      <img
        className="bxlinstagram-alt-icon"
        alt="icon"
        src="/akariconsfacebookfill.png"
      />
      <img className="arrow-vector-icon" alt="icon" src="/twitter.png" />
      <img
        className="akar-iconsfacebook-fill1"
        alt="instagram"
        src="/instagram.png"
      />
    </div>
  );
};

export default Profileicons;
